import streamlit as st
import warnings
from streamlit_option_menu import option_menu
import plotly.express as px
import pandas as pd
import base64
import plotly.graph_objects as go
import math
import time

#st.set_option('warn_on_exception', False)
def local_css(file_name):
    with open(file_name) as f:
        st.markdown(f"<style>{f.read()}</style>", unsafe_allow_html=True)

# Create a function that displays a project image and description
def show_project(image, description):
  st.image(image, width=700)
  st.markdown(description)
local_css("./style/style.css")
st.title("Raymond Sekgobela")
st.success("Data Analyst | Data Scientist | Business Intelligence Specialist | BI Consultant")
st.write("---")
#with st.sidebar:
selected = option_menu(
  menu_title=None,
            options=["Cohort","Revenues","Segments","Marketing"],
            icons=["bar-chart-line","pie-chart","diagram-3"],
            menu_icon="person",
            default_index=0,
            orientation="horizontal",
        )
#st.write("---")
# Display a loading indicator
with st.spinner("Loading..."):
    # Perform some time-consuming operation
    time.sleep(5)

# Add a title to the app
if selected == "Cohort":
  
  st.header("Customer Data Analysis and Prediction Tool")
  st.header("Table of Contents")
  st.write("""
  0. Tools Used
  1. About the App
  2. Customer Analytics Dashboard App
  3. Full Project
  """)
  st.subheader("0. Tools Used")
  st.write("""
    - Python programming language
    - Pandas library for data manipulation and analysis
    - Numpy library for numerical computing
    - Joblib library for saving and loading Python objects
    - Plydata library for data manipulation
    - XGBoost library for training gradient boosting models (classification and regression)
    - Scikit-learn library for machine learning tasks such as model selection
    - plotnine (a library based on ggplot2) for data visualization
    - Data manipulation, feature engineering, and model selection skills
    """)
  st.subheader("1. About the App")
  st.write("""
  - It allows a business to analyze their customer data and make more informed decisions about their marketing and sales strategies.
  - It has a filter feature that allows the user to focus on specific customers based on their predicted spending, which can be helpful for targeting marketing efforts and identifying potential sales opportunities.
  - It generates plots showing the relationship between predicted and actual spending, predicted probability and frequency, and the difference between predicted and actual spending, which can provide valuable insights into customer behavior and the effectiveness of the business's predictions.
  - It has a button that allows the user to download the filtered data as a CSV file, which can be useful for further analysis or for sharing the data with other stakeholders.
  Overall, the app has the potential to help a business better understand their customer data and make more informed decisions about how to engage with and serve their customers.
  """)
  st.write('---')
  def download_data(df):
    csv = df.to_csv(index=False)
    b64 = base64.b64encode(csv.encode()).decode()  # some strings <-> bytes conversions necessary here
    href = f'<a href="data:file/csv;base64,{b64}" download="myfilename.csv">Download CSV File</a>'
    st.markdown(href, unsafe_allow_html=True)

  # Load the data into a Pandas DataFrame
  df = pd.read_csv('cx.csv')
  st.subheader("Model Accuracy")
  st.write('''
  - Even though the model has been trained, tuned, and optimized before deployment, a scatter plot is still a valuable tool for evaluating the accuracy of the predictive model. 
  - It allows us to visualize the relationship between predicted and actual values, identify patterns and trends in the data, and identify any unusual observations. 
  - By analyzing this scatter plot, I could quickly and easily assess the performance of the model and identify areas for improvement or further investigation. .
  ''')
  # Create a plot showing the relationship between predicted spend and actual spend
  fig = px.scatter(df, x='pred_spend', y='total_90day_spend')
  fig.update_layout(
      xaxis_title="Last 90 Days Spending - Predicted",
      yaxis_title="Last 90 Days Spending - Actual",
      title="Predicted vs Actual Spending"
  )
  st.plotly_chart(fig)

  st.write('---')
  st.write('###')
  # Add a filter to select customers based on their predicted spend
  st.header("2. Customer Analytics Dashboard")
  st.write("Filter based on predicted spending in the next 90 days")
  pred_spend_threshold = st.slider(f'The displayed customers are predicted to spend at least the selected amount in the next 90 days', min_value=float(df['pred_spend'].min()), max_value=float(df['pred_spend'].values.max()), step=0.01)
  filtered_df = df[df['pred_spend'] >= pred_spend_threshold]
  st.subheader("")
  # Create a plot showing the relationship between predicted probability and frequency
  fig = px.scatter(filtered_df, x='frequency', y='pred_prob', color='pred_prob', color_continuous_scale=px.colors.sequential.Plasma)
  fig.update_layout(
      xaxis_title="Frequency",
      yaxis_title="Predicted Probability",
      title="Spending Probability vs Frequency"
  )

  fig = go.Figure()

  fig.add_trace(go.Scatter(
      x = filtered_df['frequency'],
      y = filtered_df['pred_prob'],
      text = filtered_df.apply(lambda row: "<br>".join([f"{column}: {round(row[column],2)}" for column in ['customers_id','pred_spend','pred_prob',  'recency', 'frequency', 'total_90day_spend', 'pred_actual_spend_delta']]), axis=1),
      mode='markers',
      marker=dict(
          color=filtered_df['pred_actual_spend_delta'],  # color the markers based on the 'pred_prob' column
          colorscale='Plasma'  # use the 'Viridis' color scale
      )
  ))

  fig.update_layout(
      xaxis_title="Frequency",
      yaxis_title="Probability of Spending",
      title="Spending Probability vs Frequency"
  )

  st.plotly_chart(fig)
  # Add a button to download the data
  if st.button('Download Segment'):
      download_data(filtered_df)
  st.write('---')
  st.header("Full Project")
  st.subheader("Steps Taken in This Project")
  st.write("""
  1. Loaded and cleaned customer purchase data from a CSV file using pandas
  2. Converted datetime objects in the "date" column to datetime datatype
  3. Performed cohort analysis on the data, examining first purchases made by each customer
  4. Created subset of data for further analysis
  5. Used the XGBoost library to train and tune a gradient boosting model for classification or regression tasks
  6. Used grid search cross-validation to find the optimal hyperparameters for the model
  7. Visualized the results of the analysis using the plotnine library
  """)
  st.write('---')
  st.header('Jupyter Notebook')
